import axios from 'axios';
import React from 'react';

axios.get('./api/users/')
    .then(res => {
        const result = res.data;
        return result;
    })
export default function UserView(){
    return (
        <div className="App">
          <table>
            <tr>
              <th>Name</th>
              <th>Age</th>
              <th>Gender</th>
            </tr>
            {result.map((val, key) => {
              return (
                <tr key={key}>
                  <td>{val.name}</td>
                  <td>{val.age}</td>
                  <td>{val.gender}</td>
                </tr>
              )
            })}
          </table>
        </div>
      );
}
